import '../styles/timeline.css';

function Timeline() {
  return (
    <>
        <div class="title">TIMELINE</div>
        <div class="event-section">
            <div class="time"></div>
            <div class="left-line"></div>
            <div class="dot"></div>
        </div>
    </>
  );
}

export default Timeline;
